import ListGroup from "react-bootstrap/ListGroup";

const SolInstList = ({ solInsts }) => {
  return (
    <>
      <ListGroup as="ul">
        {solInsts.length === 0
          ? "NO"
          : solInsts.map((solInst) => (
              <ListGroup.Item as="li" key={solInst.id}>
                {solInst.name}
              </ListGroup.Item>
            ))}
      </ListGroup>
    </>
  );
};

export default SolInstList;
